window.bookSummaryJSON = "<p>The first book in Dav Pilkey's megabest-selling Captain Underpants series, now available in SoundORama! </p> <p>Fourth graders George Beard and Harold Hutchins are a couple of class clowns. The only thing they enjoy more than playing practical jokes is creating their own comic books. And together they’ve created the greatest superhero in the history of their elementary school: Captain Underpants! His true identity is SO secret, even HE doesn’t know who he is! </p> <p>The Captain Underpants series is perfect for listeners of all ages. Like the other outrageously funny books by acclaimed author and Caldecott Honor illustrator Dav Pilkey, this adventure is sure to be hours of fun!</p>"; 
